import { React } from 'react';
import NavBar from './components/NavBar/NavBar'
import Hero from './components/Hero/Hero';
import Particles from 'react-particles-js';


function App() {
  return (
    <div>
      <Particles
        params={{
          particles: {
            number: {
              value: 200,
              density: {
                enable: true,
                value_area: 1000,
              }
            },
          },
        }}
      />
      <NavBar />
      <Hero />
    </div>
  );
}



export default App;
